\section*{Grade 8 / Sec~2 Difficulty Triage}

\subsection*{Especially Challenging}
\begin{itemize}[leftmargin=1.25em]
  \item \textbf{Q2} (rates/work): Compare two unknown-time scenarios, then transfer to a third case; equation setup and proportional reasoning are non-trivial; ``3 more days'' clause is easy to misread.
  \item \textbf{Q16(a)} (make $x$ the subject): Rearranging a rational expression in $x$ leads to a quadratic in $x$ with parameter $y$; also requires noting domain restrictions.
  \item \textbf{Q17(a)} (rational equation): LCM with $(3-2x)$ vs.\ $(4x-6)$ sign traps; high risk of extraneous solutions and domain slips.
  \item \textbf{Q17(b)} (rational equation): Factor $2x^2-x-3=(2x-3)(x+1)$, cancel carefully with domain checks, then solve; again extraneous-root vigilance.
  \item \textbf{Q14} (algebraic fractions): Key structure is $4y-2x=-2(x-2y)$; missing this sign relation yields wrong result.
\end{itemize}

\subsection*{Tricky (Doable with Scaffolding)}
\begin{itemize}[leftmargin=1.25em]
  \item \textbf{Q1(i)} (piecewise rate): Manpower changes mid-task; must compute work done, remaining work, then new rate; ``days more'' vs.\ ``total days'' confusion is common.
  \item \textbf{Q5(b)} (numeric identity mapping): Requires spotting and applying the algebraic result from Q5(a) to large numbers.
  \item \textbf{Q7(a,b)} (identity use): Fluent use of $(m+n)^2=m^2+n^2+2mn$ and $(m-n)^2=m^2+n^2-2mn$; sign discipline is the hurdle.
  \item \textbf{Q11, Q13, Q15} (algebraic fractions): Factoring, cancellation, simplification, and domain checks under time pressure.
\end{itemize}

\subsection*{Generally Accessible (Core Practice)}
\begin{itemize}[leftmargin=1.25em]
  \item \textbf{Q1(ii), Q3, Q4, Q8, Q9, Q10, Q12}: Standard linear equations, factoring, indices, and routine fraction multiplication/division.
\end{itemize}

\subsection*{Suggested Tiering}
\begin{itemize}[leftmargin=1.25em]
  \item \textbf{Challenge/Extension}: Q2, Q16(a), Q17(a), Q17(b), Q14.
  \item \textbf{Stretch}: Q1(i), Q5(b), Q7(a,b), Q11, Q13, Q15.
  \item \textbf{Core}: Q1(ii), Q3, Q4, Q8, Q9, Q10, Q12.
\end{itemize}

\end{document}
